import React from 'react'
import { Box, Container, Flex } from "@chakra-ui/react";


export default function Navbar() {
  return (
    <Box>
      <Flex></Flex>
    <Container maxW='container.sm' bg='green.400' color='#262626'>
    "container.sm" Container
  </Container></Box>
  )
}
